    portals and electronic health record (EHR) systems to use existing code sets to
    link to relevant, authoritative health information from MedlinePlus.gov.  Matches
    ICD-9-CM or SNOMED CT codes to related MedlinePlus consumer health information,
    LOINC codes to information on lab tests, and also matches NDC, RXCUI or text strings
    to patient medication information.</p>n",nt"owner_org": "3609164c-4c49-4a44-9179-23163027dc0a",nt"extras":
